function fadeOutThenIn(view, callback){
    view.bind(finishTransition, function(event){
        var target = view.parent().find(event.target);
        if(target.is(view)){
            view.unbind(finishTransition);
            callback();
            view.css("opacity", 1);    
        }   
    });
    view.css("opacity", 0);
}

